    const [data, setData] = useState([]);
    return (
        <div>{data.map((value, i) => {
            return (
                <div key={i}>
                   <h3>{props.value.name}</h3>
                   <span>{props.value.price}</span>
                </div>
            )
        })}
        </div>
    )
}

export default Sapatos
